import Labs from "./index.js";
import HelloWorld from "./a6/hello-world";
import Tuiter from "../tuiter";
import {BrowserRouter} from "react-router-dom";
import {Routes, Route} from "react-router";


function App() {
    return (
        <BrowserRouter>
        <div className="container">
            <Routes>
                <Route index
                       element={<Labs/>}/>
                <Route path="/hello"
                       element={<HelloWorld/>}/>
                <Route path="/tuiter"
                       element={<Tuiter/>}/>
            </Routes>
        </div>
        </BrowserRouter>
    );
            }
export default App;
